import React,{useState,useEffect} from 'react'
import Mapping from './Mapping'
import ControlBox from './ControlBox'
import PictureGallery from './PictureGallery'
import Queue from './Components/Queue'
import ReactNotification from '../node_modules/react-notifications-component'
import {store} from '../node_modules/react-notifications-component'
import '../node_modules/react-notifications-component/dist/theme.css'

export default function RightBody({setClickGallery,clickGallery,setQueueOnClick,queueOnClick}) {
    const [buttonSubmit,setButtonSubmit] = useState(false)

    useEffect(()=>{
        if(buttonSubmit){
            store.addNotification({
                title:"New search",
                message:"User something has searched something",
                type: "success",
                container:"bottom-right",
                insert:"bottom",
                // animationIn:["animated","fadeIn"],
                // animationOut:["animated","fadeOut"],
                // dismiss: {
                //     duration: 2000,
                //     onScreen: true
                // },
                width:400
            })               
        }
    },[buttonSubmit])

    return (
        <>
            <ControlBox buttonSubmit={buttonSubmit} setButtonSubmit={setButtonSubmit}/>
            <Mapping/>
            {clickGallery ? <PictureGallery setClickGallery={setClickGallery}/>: ""}
            {queueOnClick ? <Queue setQueueOnClick={setQueueOnClick}/>: ""}
            <ReactNotification/>

        </>
    )
}
